import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import NavBar from './components/NavBar';
import Login from './auth/Login';
import ProtectedRoute from './auth/ProtectedRoute';

import Dashboard from './admin/Dashboard';
import AddTenant from './admin/AddTenant';
import Tenants from './admin/Tenants';

import UserDashboard from './user/Dashboard';

const App = () => {
  return (
    <Router>
      <NavBar />
      <div className="p-4 max-w-4xl mx-auto">
        <Routes>
          <Route path="/login" element={<Login />} />

          {/* Admin Routes */}
          <Route path="/admin" element={<ProtectedRoute role="admin"><AdminDashboard /></ProtectedRoute>} />
          <Route path="/admin/tenants" element={<ProtectedRoute role="admin"><Tenants /></ProtectedRoute>} />
          <Route path="/admin/add-tenant" element={<ProtectedRoute role="admin"><AddTenant /></ProtectedRoute>} />

          {/* User Routes */}
          <Route path="/user" element={<ProtectedRoute role="user"><UserDashboard /></ProtectedRoute>} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
